import React from 'react';
import './shedule.css';
import Featured from '../../components/featured/Featured';
const Shedule = () => {
    return (
        <div className='Shedule'>
            <Featured />
            <p>Will be updated after the paper selecting process of ICEIET is completed</p>
                    
        </div>  
    );
}

export default Shedule;
